import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Video from "../../../components/Videos/Video";
import ModalVideo from "../../../components/Videos/ModalVideo";

class TeddyBearSection extends React.Component {
  render() {
    return (
      <Container>
        <h2>Teddys Bear Media</h2>
        <Row>
          <Col md={6}>
            <ModalVideo
              buttonText="Watch Bear Dance"
              headerText="Bear Dance"
              youTubeId="in2uTrA8OMk"
              title="Bear Dance by Bartok"
            />
          </Col>
          <Col md={6}>
            <ModalVideo
              buttonText="Watch Bear Hunt"
              headerText="Bear Hunt"
              youTubeId="Kg3Nk8VT48A"
              title="We're Goin' on a Bear Hunt"
            />
          </Col>
        </Row>
      </Container>
    );
  }
}

export default TeddyBearSection;
